 and how the continued impact of this virus is a shared responsibility. We are doing our part to stay safe and abide by Los Angeles\u2019 Stay At Home order while continuing to service our customers responsibly. \nWe are currently maintaining a skeleton crew of a few volunteer employees (less than 5) that are working to keep our current production schedule on track. We have received plenty of inquiries as to whether we are open for business, and although we are striving to stay open as much as possible during these times, we are insisting that everyone do their parts by placing new orders via our website, via email or over the phone. \nOnce orders are completed, we have developed a few options to get these orders in our clients\u2019 hands. We have integrated a \u201ccurbside pickup\u201d model for those that still want to pick up their order in person. Simply call ahead and we can meet you outside with your order without the need to get out of the car. \nWe are also offering to cover the first $35 towards the shipping cost on any completed invoice. We understand that it is safer to stay home and want to help do our part to facilitate that.\n\u2022\n\u2022\n\u2022\n#dtla #dtlaartsdistrict #screenprinters #screenprintingshop #smallbusiness #smallbusinessowner #covid_19 #coronavirus"}}]},"edge_media_to_comment":{"count":3},"comments_disabled":false,"taken_at_timestamp":1585081616,"edge_liked_by":{"count":32},"edge_media_preview_like":{"count":32},"location":{"id":"323911671","has_public_page":true,"name":"Print Renegades","slug":"print-renegades"},"thumbnail_src":"https:\/\/instagram.fozh1-1.fna.fbcdn.net\/v\/t51.2885-15\/sh0.08\/e35\/c0.140.1440.1440a\/s640x640\/90636628_204347340873124_4889657614500558000_n.jpg?_nc_ht=instagram.fozh1-1.fna.fbcdn.net&_nc_cat=104&_nc_ohc=3nV5muaTCHcAX-l3aRY&oh=e7964a9bb5999b6e9c6cadb892e832ba&oe=5F188F3E","thumbnail_resources":[{"src":"https:\/\/instagram.fozh1-1.fna.fbcdn.net\/v\/t51.2885-15\/e35\/c0.140.1440.1440a\/s150x150\/9063662